import { useRouter } from 'next/router'

import MainLayout from '@/components/layouts/MainLayout'

const Category = () => {
  const router = useRouter()

  const meta = {
    title: 'a',
    keywords: [
      'a'
    ],
    description: 'a'
  }

  const { query: { id } } = router

  return (
    <MainLayout meta={meta}>
      <CategoryBody
        category_id={id} />
    </MainLayout >
  )
}

export default Category
